You can also pull modules from other channels. All modules have access to the modulesPath for each channel as <channelName>ModulesPath. And you can use disabledModules to remove modules from the current channel. To pull zsh module from the latest channel this code can be placed in any module, whether its your host file, a profile, or a module in ./modules etc: { latestModulesPath }:
{ imports = [ "${latestModulesPath}/programs/zsh/zsh.nix" ]; disabledModules = [ "programs/zsh/zsh.nix" ];
} Note: Sometimes a modules name will change from one branch to another.

